import React from 'react';
import './App.css'
import Login from '../others/login/Login';
import Profile from '../my-profile/my-profile';
import Login2 from '../login2/login2'
import Landing from '../others/landing/landing';
import Home from '../others/home/home';
import Registration from '../registration/registration';
import ProfileCard from '../my-profile/profile-card';
import Navbar from '../navbar/navbar';
import { Route, Switch} from "react-router-dom"



function App() {


  return (

    <>
         <Navbar />
         <div className='wrapper'>
      <Switch>
          <Route exact path="/Profile"><AnimalData/></Route>
          <Route exact path="/organization" > <AnimalOrganizationData/> </Route>
          {/* <Route exact path="/type" > <Breeds/> </Route> */}
          <Route exact path="/"> <Home /> </Route>
        </Switch>
        </div>
    </>

  );
}

export default App;
